INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `location`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`) VALUES(2, 1, 1490204226, 'Sunday Breakfast Club', 'sunday-breakfast-club', 1, '1', 1471039200, 1471053600, 1471039200, NULL, 'Cologne', '<p>Pop-up breakfast place in Cologne. Tasty 5 course breakfast prepared by foodies for foodies at my place in the center of cologne. Want to be there? Drop me a line!</p>', '', NULL, '', '', '', '', '', '', 'above', '1', 'a:2:{s:4:"unit";s:4:"days";s:5:"value";s:1:"7";}', 2145913200, 0, '', NULL, 'default', 0, 0, '', '', '', '', '1', '', '');
