INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `location`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`) VALUES(4, 1, 1490204455, 'Night Market', 'night-market', 1, '1', 1470801600, 1470819600, 1470780000, NULL, 'Rudolfplatz, Cologne', '<p>Food trucks, Wine and beer, bands and good times. The market opens at 16:00 and is geared up for workers who don''t get chance to visit the daily markets in cologne. Except you can''t get much to take home with you.[nbsp]</p>', '1', 0x8eb414c60f0911e7a370b1a115865f49, '', 'a:3:{i:0;s:3:"200";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', 'meat and eat', 'left', '1', 'a:2:{s:4:"unit";s:4:"days";s:5:"value";s:1:"7";}', 2145913200, 0, '', NULL, 'default', 0, 0, '', '', '', '', '1', '', '');

