INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(1, 2, 1490274164, 'New Beginnings', 'new-beginnings', 1, 1490289780, 1490289780, 'Gentrify synth raw denim', '<p>Use the Themes Custome Frontend Modules to either display news teasers without images or only the news teasers with images.</p>\n<p>Cold-pressed fashion axe neutra, pickled tousled yr chia. Sartorial stumptown YOLO, +1 thundercats small batch freegan craft beer lo-fi knausgaard ugh normcore distillery. Bicycle rights tousled franzen tumblr.[nbsp]You probably haven''t heard of them ethical retro art party. PBR[&]B selfies cred austin man braid intelligentsia biodiesel.</p>', '1', 0x8ea9be6a0f0911e7a370b1a115865f49, 'Example text for image', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:1:"1";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '1', 'Image Caption', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(2, 2, 1490203613, 'Expressing!', 'new-news', 1, 1490203500, 1490203500, 'Subheadline', '<p>Blog shabby chic meditation, +1 fashion axe artisan chillwave aesthetic pop-up godard vice taxidermy green juice. Bespoke forage affogato stumptown meditation, cornhole microdosing pop-up pork belly.</p>\n<p>Fingerstache cronut biodiesel cornhole crucifix, single-origin coffee viral tumblr neutra blog green juice. Brunch meditation retro master cleanse, sustainable trust fund skateboard tattooed.</p>', '1', 0x8eb414da0f0911e7a370b1a115865f49, 'Example text for image', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:1:"1";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', 'A caption is optional', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(3, 2, 1490274016, 'Frontpage News', 'frontpage-news', 1, 1490030760, 1490030760, 'Subheadline', '<p>Blind Text: Thundercats slow-carb poutine, normcore vinyl salvia bicycle rights intelligentsia hashtag fingerstache yuccie ugh. Pug helvetica stumptown readymade, fixie kogi pabst. Wayfarers chicharrones pinterest, vice polaroid retro man bun meditation 8-bit tousled kinfolk. Poutine cornhole fixie, VHS mumblecore selvage actually swag roof party.[nbsp]Pop-up heirloom bushwick master cleanse gentrify synth raw denim.</p>', '', NULL, '', '', '', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '');

